import { toast } from "react-toastify";

const BuyABot = () => {
  const d = document;

  let botLevel = localStorage.getItem("web_cache_ls11");
  let bnbBotLevel = localStorage.getItem("BotLevelBNB");

  const [amount = 35, setAmount, amountBNB = 0.12] = useState(); // Monto del Donate
