    } else {
      toast.warn("Launch date is Saturday 14th May 2022 at 7pm UTC", {
        position: "bottom-right",
      });
    }
  };

  let isFirst100BNB = localStorage.getItem("first100BNB");
  let isFirst100USDT = localStorage.getItem("first100USDT");

  const BNBdonate = () => {
    if (new Date().getTime() > 1652554800000) {
      // if (donateText === "Enable") {
